        "Name": "Krone der Weisheit",
        "Desc": "Wertvolles Material, das zum Verbessern von Talenten bentigt wird.<br>Ein rituelles Hilfsmittel, das in alter Zeit fr die Weitergabe von Wissen genutzt wurde. Heutzutage jedoch liegt Wissen in gesprochener und niedergeschriebener Sprache. Die in der Krone der Weisheit gespeicherte Kraft kann heute sicherlich immer noch auf den Menschen abfrben.",
