        "R": 3,
        "Name": "Anleitung zur Vergnglichkeit",
        "Desc": "Material zur Verbesserung von Talenten.<br>Vergnglichkeit ist der Traum des Reichs des Blitzes.<br>Wir finden die grten Freuden im sterblichen Leben in vergnglichen Trumen, denn ist das Leben selbst nicht wie der Schatten des Donners? Verfolge deine Trume bis in die Wolken, wenn du willst, und geniee die unerwartete Stille der schummrigen, lampenbeleuchteten Nchte.",
