        "Desc": "Material zur Verbesserung von Talenten.<br>Eleganz ist die Form des Reichs des Blitzes.<br>Eleganz meidet Arroganz. Die Eleganten sind immer bescheiden und nur wenn man Eitelkeit und Trgheit ablegt, kann man klar sehen. Und gibt es nicht Schnheit und Liebenswrdigkeit selbst in den niedersten uerlichkeiten?",
