        "Desc": "Material zur Verbesserung von Talenten.<br>Licht ist die Sehnsucht des Reichs des Blitzes.<br>Auch wenn die Sonnenstrahlen selbst durch Schichten ber Schichten von Wolken blockiert werden sollten, gibt es im Land des Donnergottes immer noch diejenigen, die davon trumen, dieses zornige Meer von Blitzen zu durchdringen, um die Herrlichkeit des Gttlichen zu verfolgen, ohne zu frchten, dass sie grausam niedergestreckt werden.",
