        "Desc": "Material zur Verbesserung von Talenten.<br>Ermahnung ist der Zweig des Reiches der Weisheit.<br>Ermahnung und sorgfltige berlegung gehren untrennbar zusammen. Sich mit Demut und Klarheit auszudrcken, erfordert viel Nachdenken und Reflexion. Nur so kann man die Weisen berzeugen, die Narren erwecken, und die Weisheit wie einen Fluss flieen lassen.",
