        "Desc": "Material zur Verbesserung von Talenten.<br>Findigkeit ist die Vene des Reichs der Weisheit.<br>Findigkeit fhrt zu aufrichtigen Worten. Wer aus gutem Willen denkt und klug berlegt, dessen Worte werden nie den Pfad des Wohlergehens verlassen. Wer aber aus Rcksichtslosigkeit und Boshaftigkeit spricht, dessen Worte werden verachtenswert und unwrdig.",
