        "Name": "Anleitung zur Praxis",
        "Desc": "Material zur Verbesserung von Talenten.<br>Die Praxis ist die Wurzel des Reichs der Weisheit.<br>Die Praxis besttigt die Ehrlichkeit in den Worten. Auch wenn alles Denken, alles Handeln, gut ist, kann man dennoch es nicht als Weisheit nennen. Aus Taten geborene Weisheit legt ein Siegel auf ehrliche Worte.",
