        "Desc": "Material zur Verbesserung von Talenten.<br>Denn der Damm des Reichs des Wassers ist Fairness.<br>Fairness ist das Fundament von Fontaines Staatlichkeit und wenn das Gesetz seine Fairness einbt, ist es nur noch ein Spielbrett des Profits.",
