        "Desc": "Material zur Verbesserung von Talenten.<br>Denn das Schwert des Reichs des Wassers ist Gerechtigkeit.<br>Die Gesetze von Fontaine werden mit dem Schwert der Gerechtigkeit gefhrt. Die Gerechtigkeit ist blind, denn die, die ihre scharfe Klinge fhren, lassen sich weder von persnlichen Interessen noch von Eigennutz treiben.",
