        "R": 3,
        "Name": "Thelxies fantastische Abenteuer",
        "Desc": "Ein dreiseitiges Mrchenbuch, das die zauberhafte Geschichte eines Prinzen erzhlt, der die Einsamkeit berwindet.<br>Auf der Rckseite findet sich in kleinen Buchstaben Fr alle, die es gerade schwer haben geschrieben.",
